INSERT INTO `home_event` VALUES ('Non-Technical','AALAPANA','This is a solo singing competition of classical aalapanas.','1. This round will be conducted in offline mode.\r\n2. The participant is allowed to sing only 1 song within the prescribed time.\r\n3. There is no limit on number of participants from one college.\r\n4. We are requesting you to bring your instruments for classical aalapanas if so required.\r\n5. Participants will be shortlisted based on their performance. (ex: vocal presentation, voice clarity, pitch clarity, etc.)\r\n6. Each finalist will be told by the judges by their performance.\r\n7. As per the number of participants registered, conducting of the event will be decided on that day.\r\n8. The top three Participants will be awarded, and all the other participants will receive a Certificate of Participation.',1,'1. 5 minutes will be given for each participant\r\n2. Only 1 song is allowed for one participant','-','-',1,'Offline','Chunduru Raja Chowdary','9951242080','G. Nikitha','7995956030',2500,1500,1000,'2022-03-30 03:55:47.000000','CSE block','','General','Offline'),('Technical','AI WISDOM','This is a offline paper presentation event for the Artificial Intelligence domain aspirants','Event Guidelines: -\r\nFirst Round: \r\n1.Participants will be given a time duration of 1hour each.\r\n2.This round will be conducted in offline mode.\r\n3.The Participant should be present in the allocated room in the given time slot during the event.\r\n4.Participants should explain their presentations to judges and fellow students.\r\n5.They have to Participate when their token numbers are called out and utilize the opportunity.\r\n6.Participants will be shortlisted based on judges marks.\r\n7.As per the number of participants registered, conducting of the event will be decided on that day.\r\n8.The top three Participants will be awarded, and all the other participants will receive a Certificate of Participation.',1,'First Round: \r\n1.Participants will be given a time duration of 1hour each.\r\n2.This round will be conducted in offline mode.\r\n3.The Participant should be present in the allocated room in the given time slot during the event.\r\n4.Participants should explain their presentations to judges and fellow students.\r\n5.They have to Participate when their token numbers are called out and utilize the opportunity.\r\n6.Participants will be shortlisted based on judges marks.\r\n7.As per the number of participants registered, conducting of the event will be decided on that day.\r\n8.The top three Participants will be awarded, and all the other participants will receive a Certificate of Participation.','-','-',1,'Offline','Gnandeep','994970374','I.Siddhartha','999999999',2500,1500,1000,'2022-03-30 03:30:00.000000','-','','General','Offline'),('spot events','Among us','This is an online multiplayer social deduction game, and a player can either be a crewmate or an imposter.','First Round: \r\n1.Participants will be given time duration of one match.\r\n2.This round will be conducted in online mode.\r\n3.The Participant will enter into the room with the provided room id.\r\n4.Room Id will be provided by us.',1,'1.Participants will be given time duration of one match.\r\n2.This round will be conducted in online mode.\r\n3.The Participant will enter into the room with the provided room id.\r\n4.Room Id will be provided by us.','*','*',4,'online','S. SUSHEEL GUPTHA','9515858993','I SIDDHARTHA','9248486648',1250,750,500,'2022-03-30 03:30:00.000000','-','','spot events','online mode'),('Non-Technical','Appthon','This is a workshop-competition on the details of app making\r\nA sample app will be asked to be created by the participants.','1. Participants will be given time duration of 3 hours each.\r\n2. This round will be conducted in offline mode.\r\n3. The Participant should be present in the allocated room in the given time slot during the event.\r\n4. This is a workshop-competition on app making.\r\n5. Participant shoul