ia.\r\n9.Participants should attend the event virtual in the allocated room.\r\n10.Time duration 20 min.','1.Participants will be given time duration of 1hour each.\r\n2.This round will be conducted in online mode.\r\n3.The Participant should be in the allotted venue.\r\n4.Participants should not talk while the event is going on.\r\n5.They have to Participate when their token numbers are called out and utilize the opportunity.\r\n6.Participants will be shortlisted based on their performance.\r\n7.The judges will judge give the score based on the performance on the following basis: - Time you played to escape the room.\r\n8.The game play will be given a score out of 50 on the before-mentioned criteria.\r\n9.Participants should attend the event virtual in the allocated room.\r\n10.Time duration 15 min.','1.Participants will be given time duration of 1hour each.\r\n2.This round will be conducted in online mode.\r\n3.The Participant should be in the allotted venue.\r\n4.Participants should not talk while the event is going on.\r\n5.They have to Participate when their token numbers are called out and utilize the opportunity.\r\n6.Participants will be shortlisted based on their performance.\r\n7.The judges will judge give the score based on the performance on the following basis: - Time you played to escape the room.\r\n8.The game play will be given a score out of 50 on the before-mentioned criteria.\r\n9.Participants should attend the event virtual in the allocated room.\r\n10.Time duration 10 min.',1,'online','J PRAVEEN','8341667967','SUMANTH','9848866076',2500,1500,1000,'2022-03-30 03:30:00.000000','-','','GENERAL','online mode'),('Non-Technical','Vogue','Vogue is an event conducted in our university to identify the talent in youths and let them know the Indian culture, attire and to exhibit their talents.This event is conducted in only one round and the best in all categories such as speaking skills, stage behave skills will be awarded with the prizes by the chief gue